description:
Dave Bartholomew in Bern 1990.

&quot;New Orleans music man, Dave Bartholomew is one of the truly distinguished figures of the delta music scene, a man with multi talents as a songwriter, producer, bandleader and horn player who spans many eras of popular music genres. Known in many circles for his long and fruitful music and songwriting partnership with another crescent city music personality, Antoine &quot;Fats&quot; Domino.&quot;

You'll also find a few clips from the Roots &amp; Rock festival 1992 with Taj Mahal, Neville Brothers, Los Lobos, Marcia Ball, Leon Russell, Ritchie Havens, Indigo Girls a.o.
